INSERT INTO `episodes` (`id`, `titolo`, `ordine`, `durata`, `copertina`, `descrizione`, `season_id`, `created_at`, `updated_at`) VALUES
(1, 'Episodio 1', 1, 47, 'url all\'immagine di copertina del film', 'Provenienti da realtà opposte, Filippo e Carmine si ritrovano a condividere la stessa cella in un istituto di pena minorile di Napoli per scontare due pesanti accuse.', 1, '2024-03-04 11:46:36', '2024-03-04 11:46:36'),
(2, 'Episodio 2', 2, 58, 'url all\'immagine di copertina del film', 'Mentre Carmine conosce le regole del carcere, Filippo è un pesce fuor d\'acqua ed è preso di mira dagli altri detenuti. Il comandante Massimo decide di non intervenire.', 1, '2024-03-04 11:46:36', '2024-03-04 11:46:36');
INSERT INTO `films` (`id`, `titolo`, `regia`, `anno`, `durata`, `lingua`, `copertina`, `anteprima`, `trama`, `nation_id`, `created_at`, `updated_at`) VALUES
(1, 'Titanic', 'James Cameron', 1997, 195, 'inglese', 'url all\'immagine di copertina del film', 'url al video di anteprima del film', 'È il film per eccellenza narrante la tragica storia dell\'affondamento del più grande transatlantico del mondo, a quel tempo. Il Titanic, considerato inaffondabile, aveva cabite per tre classi sociali diverse, sale da pranzo e da ballo, ristoranti e i comfort più lussuosi. È proprio tra questi che la giovane e aristocratica Rose incontra il semplice ma affascinante Jack, passeggero di terza classe con il quale stringerà un legame talmente profondo da sopravvivere anche nella tragedia di quella notte in cui il Titanic affondò.', 234, '2024-03-04 11:46:36', '2024-03-04 11:46:36'),
(2, 'Avengers: Infinity War', 'Anthony & Joe Russo', 2018, 149, 'inglese', 'url all\'immagine di copertina del film', 'url al video di anteprima del film', 'La nave spaziale di Thanos è in rotta verso la Terra. ll tiranno si imbatte nell\'astronave che trasportava Thor e gli altri superstiti asgardiani, e uccide Loki a mani nude. Il dio del tuono viene salvato, disperso nello spazio, dai guardiani della galassia, che decidono di aiutarlo nella sua missione per sconfiggere Thanos. Nel frattempo sul nostro pianeta Tony Stark viene avvisato da Stephen Strange del pericolo prossimo ad arrivare e dopo un breve scontro nelle strade cittadine, i supereroi (coadiuvati dall\'Uomo Ragno) si mettono all\'inseguimento dell\'astronave finendo loro stessi nello spazio. Anche Captain America e gli altri Avengers si stanno organizzando per affrontare l\'incombente minaccia, ma scopriranno ben presto di avere a che fare con un avversario dai poteri devastanti.', 234, '2024-03-04 11:46:36', '2024-03-04 11:46:36');
